wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(80846142033213268)
,p_plug_name=>'Pracownik'
,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    ID_PRACOWNIKA,',
'    IMIE,',
'    NAZWISKO,',
'    DATA_ZATRUDNIENIA,',
unistr('    PLACA || '' z\0142'' AS PLACA,'),
'    CASE ',
'        WHEN STANOWISKO_PRACOWNIKA = ''Kucharz'' THEN ''X''',
'        ELSE TO_CHAR(LICZBA_OBSLUZONYCH_ZAMOWIEN)',
'    END AS LICZBA_OBSLUZONYCH_ZAMOWIEN,',
'    CASE ',
'        WHEN STANOWISKO_PRACOWNIKA = ''Kucharz'' THEN ''X''',
unistr('        ELSE NAPIWKI || '' z\0142'''),
'    END AS NAPIWKI,',
'    CASE ',
'        WHEN STANOWISKO_PRACOWNIKA = ''Kelner'' THEN ''X''',
'        ELSE TO_CHAR(LICZBA_PRZYGOTOWANYCH_DAN)',
'    END AS LICZBA_PRZYGOTOWANYCH_DAN,',
'    STANOWISKO_PRACOWNIKA',
'FROM PRACOWNIK',
'ORDER BY ID_PRACOWNIKA;'))
,p_plug_source_type=>'NATIVE_IR'
